import * as React from "react";
import styled from "styled-components";

export const Circle = () => {
  return (
    <div class="container">
      <div class="row">
        <div class="col-md-4 block">
          <div class="circle">
            <p>Some Text here Some text here</p>
          </div>
        </div>
        <div class="col-md-4 block">
          <div class="circle">
            <p>Some Text here</p>
          </div>
        </div>
        <div class="col-md-4 block">
          <div class="circle">
            <p>Some More Text here</p>
          </div>
        </div>
      </div>
    </div>
  );
};
const StyledWrapper = styled.div`
  .block {
    border: 1px solid red;
    text-align: center;
    vertical-align: middle;
  }
  .circle {
    background-color: red;
    border-radius: 200px;
    color: white;
    height: 200px;
    font-weight: bold;
    width: 200px;
    display: table;
    margin: 20px auto;
  }
  .circle p {
    vertical-align: middle;
    display: table-cell;
  }
`;
